import React, { useState } from "react";
import HighchartsReact from "highcharts-react-official";
import Highcharts from "highcharts";
import drilldown from "highcharts/modules/drilldown";

drilldown(Highcharts);

const chartTypes = ["column", "bar", "pie", "line"];

export default function ChartCreator({ data, onSave }) {
  const [chartType, setChartType] = useState("column");
  const [xKey, setXKey] = useState("");
  const [yKey, setYKey] = useState("");
  const [title, setTitle] = useState("My Chart");
  const [useDrilldown, setUseDrilldown] = useState(false);

  const keys = data.length > 0 ? Object.keys(data[0]) : [];

  // Generate drilldown series from nested data (if available)
  const buildSeries = () => {
    if (!xKey || !yKey) return [];

    if (!useDrilldown) {
      return [{
        name: yKey,
        colorByPoint: true,
        data: data.map(row => [row[xKey], row[yKey]])
      }];
    }

    // Drilldown structure
    const main = [];
    const drill = [];

    data.forEach(row => {
      const id = `${row[xKey]}-drill`;
      main.push({
        name: row[xKey],
        y: row[yKey],
        drilldown: id
      });

      if (Array.isArray(row.breakdown)) {
        drill.push({
          id,
          name: `${row[xKey]} Breakdown`,
          data: row.breakdown.map(item => [item.name, item.value])
        });
      }
    });

    return {
      mainSeries: [{
        name: "Top Level",
        colorByPoint: true,
        data: main
      }],
      drilldownSeries: drill
    };
  };

  const { mainSeries, drilldownSeries } = useDrilldown
    ? buildSeries()
    : { mainSeries: buildSeries(), drilldownSeries: [] };

  const options = {
    chart: { type: chartType },
    title: { text: title },
    xAxis: { type: "category", title: { text: xKey } },
    yAxis: { title: { text: yKey } },
    legend: { enabled: false },
    plotOptions: {
      series: {
        dataLabels: {
          enabled: true
        }
      }
    },
    series: mainSeries,
    drilldown: {
      series: drilldownSeries
    }
  };

  const handleSave = () => {
    const configJson = JSON.stringify(options);
    onSave(title, configJson);
  };

  return (
    <div>
      <h3>Create Chart</h3>

      <input
        placeholder="Chart Title"
        value={title}
        onChange={e => setTitle(e.target.value)}
      />

      <div>
        <label>Chart Type: </label>
        <select value={chartType} onChange={e => setChartType(e.target.value)}>
          {chartTypes.map(type => (
            <option key={type} value={type}>{type}</option>
          ))}
        </select>
      </div>

      <div>
        <label>X-Axis: </label>
        <select value={xKey} onChange={e => setXKey(e.target.value)}>
          <option value="">Select X</option>
          {keys.map(k => <option key={k} value={k}>{k}</option>)}
        </select>
      </div>

      <div>
        <label>Y-Axis: </label>
        <select value={yKey} onChange={e => setYKey(e.target.value)}>
          <option value="">Select Y</option>
          {keys.map(k => <option key={k} value={k}>{k}</option>)}
        </select>
      </div>

      <div>
        <label>
          <input
            type="checkbox"
            checked={useDrilldown}
            onChange={e => setUseDrilldown(e.target.checked)}
          />
          Enable Drilldown
        </label>
      </div>

      <HighchartsReact highcharts={Highcharts} options={options} />
      <button onClick={handleSave}>Save Chart</button>
    </div>
  );
}
